export const styles={
    event:{
        height: 273,
        background: "#7FD6D0",
        position: "relative"
    },
    eveFont:{
        height: 33,
        color: "#FFFFFF",
        marginTop: 12,
        lineHeight: "24px"
    },
    eveNameFont:{
        height: 57,
        color: "#000000",
        //position: "absolute",
        top: 172,
        left: "12.96%",
        lineHeight: "57px",
        fontSize: 42
    },
    github:{
        height: 43,
        //position:"absolute",
        color: "#FFFFFF",
        lineHeight: "57px",
        top: 179,
        fontSize: 32,
        //right: "14.53%"
    },
    flex:{
        display: "flex"
    },
    posiWrap:{
        display: "flex",
        marginLeft: "7.29%",
        marginTop: 49
    },
    iconposition:{
    
        color: "#000000",
        display: "flex",
        //right: "12.94%",
        //top: 191,
    },
    Nlink:{
        textDecoration: "none",
        color: "#FFFFFF",
        "&:active": {
            color: "#FFFFFF"
        }
    }
}
